  const [input, setInput] = useState('Ahmad');
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello</h1>
        <Input placeholder='Enter Todo'/>
        <Button type='submit' style={{backgroundColor: 'blue', marginTop: '10px'}}>Submit</Button>
        <ul>
          {input.map()}
        </ul>
      </header>
    </div>
  );
}

export default App;
